import {
    createApp
} from 'vue'
import App from './App.vue'

import router from './router'
import store from './store'
import Notifications from '@kyvg/vue3-notification'
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min.js'; // includes popper.js

import { QuillEditor } from 'vue3-quill'
import '@vueup/vue-quill/dist/vue-quill.snow.css';
import "leaflet/dist/leaflet.css";
import 'owl.carousel/dist/assets/owl.carousel.css';
import 'owl.carousel';
import $ from 'jquery';
import gtagPlugin from './plugins/gtag'


import vue3GoogleLogin from 'vue3-google-login'

await store.dispatch("initAuth");


store.commit('loadCartFromStorage'); // Load cart data from localStorage

import VueSweetalert2 from "vue-sweetalert2";


createApp(App).use(store,gtagPlugin, { router, id: 'G-K79WK6WBGH' }, 'QuillEditor', QuillEditor, Notifications,VueSweetalert2,vue3GoogleLogin, {
     }).use(router).mount('#app')
